import React from 'react';

import './Button.css';

const Button = props => {
  const inActive = props.isInactive;
  return (
    <button type={props.type} className={`button ${inActive ?'inactive':''}`} onClick={props.onClick}>
      {props.children}
    </button>
  );
};

export default Button;
